import React from "react";
import { Link } from "react-router-dom";






const Nav = (props) => {
  return (

    <div>
      <nav className="navbar navbar-dark bg-dark">
        <div className="d-flex container-fluid ">
          <div className="d-flex font-monospace font-weight-bold ">
            <Link to="/Home" className="mx-4 text-decoration-none " data-bs-toggle="tooltip" data-bs-placement="top" title="Hospital"><h2>Hospital</h2></Link>

            <Link to="/Ward" className="m-6  text-decoration-none " ><h2>Ward</h2></Link>
            <p className="text-primary mx-4 py-2 text-right">{props.user1}</p>
          </div>
        </div>
      </nav>
    </div>

  )

}


export default Nav;
